func TestReturnsAnEmptyArrayWhenNothingIsFound(t *testing.T) {
	ac := new()
	ac.Insert(1, "cat")
	assert(t, ac, "dog", NULL)
}

func TestWorksWithASingleSimpleValue(t *testing.T) {
	ac := new()
	ac.Insert(1, "cat")
	assert(t, ac, "c", 1, "ca", 1, "cat", 1)
}

func TestIsCaseInsensitive(t *testing.T) {
	ac := new()
	ac.Insert(3, "cAt")
	assert(t, ac, "Cat", 3)
}

func TestIgnoresNonAsciiCharacters(t *testing.T) {
	ac := new()
	ac.Insert(4, "i-Likes*cats*")
	assert(t, ac, "i", 4, "i likes cats", 4, "ILIKE", 4)
}

func TestFindsPartialWords(t *testing.T) {
	ac := new()
	ac.Insert(5, "i like cats")
	assert(t, ac, "like", 5, "cats", 5, "like cats", 5, "likecats", 5)
}

func TestFindsMultipleMatches(t *testing.T) {
	ac := new()
	ac.Insert(6, "i like cats")
	ac.Insert(7, "i like cows")
	assert(t, ac, "like", "6,7", "i like c", "7,6", "like ca", 6, "likeco", 7)
}

func TestResultsMatchingStartShowFirst(t *testing.T) {
	ac := new()
	ac.Insert(6, "i like cats")
	ac.Insert(7, "cats are cute like")
	assert(t, ac, "like", "6,7", "cat", "7,6")
}

func TestDoesNotIndexDuplicates(t *testing.T) {
	ac := new()
	ac.Insert(8, "i like cats i like")
	assert(t, ac, "cat", 8, "i like", 8)
}

func TestDeltesANIndex(t *testing.T) {
	ac := new()
	ac.Insert(9, "i like cats")
	ac.Insert(10, "i like cows")
	ac.Remove(9)
	assert(t, ac, "like", 10, "i like c", 10, "like ca", NULL, "likeco", 10)
}

