func new() *Root {
	return New(100)
}

func assert(t *testing.T, ac *Root, data ...interface{}) {
	for i := 0; i < len(data); i += 2 {
		search := data[i].(string)
		value := data[i+1]
		var expected []uint
		if value == NULL {
			expected = []uint{}
		} else if i, ok := value.(int); ok {
			expected = []uint{uint(i)}
		} else {
			parts := strings.Split(value.(string), ",")
			expected = make([]uint, len(parts))
			for i := 0; i < len(parts); i++ {
				p, _ := strconv.Atoi(parts[i])
				expected[i] = uint(p)
			}
		}

		actual := ac.Find(search)
		if len(actual) != len(expected) {
			t.Errorf("expected search for %q to return %d items, got %d instead", search, len(expected), len(actual))
		}
		for i := 0; i < len(actual); i++ {
			if actual[i] != expected[i] {
				t.Errorf("expected id at %d when searching for %q to be %d, got %d instead", i, search, expected[i], actual[i])
			}
		}
	}
}
